package com.ngdesk.company.dao;

import org.springframework.data.mongodb.core.mapping.Field;

import com.fasterxml.jackson.annotation.JsonProperty;

public class Themes {
	@JsonProperty("SIDEBAR")
	@Field("SIDEBAR")
	private Image sidebarImage = new Image("sidbar.png",
			"data:image/png;base64,",
			"ngDesk");

	@JsonProperty("LOGIN_PAGE")
	@Field("LOGIN_PAGE")
	private Image loginPage = new Image("login_page.png",
			"data:image/png;base64,",
			"Welcome to ngDesk");

	@JsonProperty("SIGNUP_PAGE")
	@Field("SIGNUP_PAGE")
	private Image signupPage = new Image("login_page.png",
			"data:image/png;base64,",
			"Signup for ngDesk");

	@JsonProperty("FAVICON")
	@Field("FAVICON")
	private Image favicon = new Image("favicon.png",
			"data:image/png;base64,",
			"ngDesk");

	@JsonProperty("PRIMARY_COLOR")
	@Field("PRIMARY_COLOR")
	private String primaryColor = "#3f51b5";

	@JsonProperty("SECONDARY_COLOR")
	@Field("SECONDARY_COLOR")
	private String secondaryColor = "#e8eaf6";

	public Themes(Image sidebarImage, Image loginPage, Image signupPage, Image favicon, String primaryColor,
			String secondaryColor) {
		super();
		this.sidebarImage = sidebarImage;
		this.loginPage = loginPage;
		this.signupPage = signupPage;
		this.favicon = favicon;
		this.primaryColor = primaryColor;
		this.secondaryColor = secondaryColor;
	}

	public Themes() {
		super();
	}

	public Image getSidebarImage() {
		return sidebarImage;
	}

	public void setSidebarImage(Image sidebarImage) {
		this.sidebarImage = sidebarImage;
	}

	public Image getLoginPage() {
		return loginPage;
	}

	public void setLoginPage(Image loginPage) {
		this.loginPage = loginPage;
	}

	public Image getSignupPage() {
		return signupPage;
	}

	public void setSignupPage(Image signupPage) {
		this.signupPage = signupPage;
	}

	public Image getFavicon() {
		return favicon;
	}

	public void setFavicon(Image favicon) {
		this.favicon = favicon;
	}

	public String getPrimaryColor() {
		return primaryColor;
	}

	public void setPrimaryColor(String primaryColor) {
		this.primaryColor = primaryColor;
	}

	public String getSecondaryColor() {
		return secondaryColor;
	}

	public void setSecondaryColor(String secondaryColor) {
		this.secondaryColor = secondaryColor;
	}

}
